    [],nt"revision_timestamp": "2016-07-27T22:55:24.845033",nt"name": "kirwin-national-wildlife-refuge-annual-narrative-report-calendar-year-1986",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    NWR outlines Refuge accomplishments during the 1986 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses the master plan and management planning. Refuge
    administration is outlined; information about personnel, youth programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, haying, fire management, pest
    control, and wilderness areas. The wildlife section of the report discusses endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, and disease control. The public uses of the Refuge
    described in this report include interpretive programs, hunting, fishing, wildlife
    observation, outdoor recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Refuge brochures and field guides
    are attached.",nt"license_title": "License Not Specified",nt"extras":
